import { UserContext } from "../context/user"
import { useState, useContext, useEffect} from 'react'
function Homepage () {

    const {user, setUser} = useContext(UserContext)

    useEffect(() => {
        fetch('/check')
          .then(r => {
            if (r.ok) {
                setUser(r.json())
            }
          })

      }, [])

    return (
        <h1>Welcome</h1>
    )
}

export default Homepage
